import { useState } from 'react';
import './App.css'
import Botao from './Botao';








function App() {
  const Numeros = Array.from({ length: 25 }, (e, i) => i + 1).sort(() => Math.random() - 0.5).filter((e, i) => i < 15);

  function chamarLista(){
    const listaNumeros = Numeros.map(
      (e,i)=><div key={i}>{e}</div>)
      return listaNumeros
  }






return (
  <div>
    <div>
      {listaNumeros}
    </div>
    <Botao onClick={chamarLista}>Gerar</Botao>  
    </div>
)

}

export default App;
